d:      .zero 16384
T1:     .zero 16384
T2:     .zero 16384
alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
        la  s1, a
        la  s2, b
        la  s3, c
        la  s4, d
        la  s5, T1
        la  s6, T2
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #

        # for(i=0,...,...){
        addi t0, zero, 4 
        add t1, zero, zero

        add a0, zero, s2 #a0 -> Follows B, *B
        add a1, zero, s6 #a1 -> Folows T2, *T2
        mul a3, s9, t0   #a3 -> 4*N
iloop:
        # for(j=0,...,...){ #Go column first
        add t2, zero, zero  #t2 is zero
jloop:        
        lw t4, 0(a0) #Get value of B
        sw t4, 0(a1) #Save it to T2
        
        # for(...,...,j++)
        addi t2, t2, 1
        add a0,a0,t0 #Go to next B column
        
        add a1,a1,a3 #Go to next T2 row
        
        # for(...,j<size,...) #Check if row of B has been transposed
        blt t2, s9, jloop
        
        #If so, reset a0 and a1 to 1st elements of B and T2
        add a0, zero, s2
        add a1, zero, s6
        
        addi t1,t1,1 #Increase i
        
        add t2,zero,a3  #t2 -> 4*N
        mul t2,t1,t2    #t2 -> 4*N*i
        add a0,a0,t2    #a0 -> correct B row
        
        #T2 goes down in column
        add t2,zero,t0 #t2 -> 4
        mul t2,t2,t1   #t2 -> 4*i
        add a1,a1,t2   #a1 -> correct T2 column
        
        # for(...,j<size,...) #Check if operation is finished
        blt t1, s9, iloop
        

        # First part: T1 = A*B #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s6 # a1 -> *T2
        add t0, zero, a1 # t0 -> *auxT2 = T2
        add a2, zero, s4 # a2 -> *D
        add a4, zero, s3 # a4 -> *C

        # for(i=0,...,...){
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += A[i][k] * ...
        lw t5, 0(a0)
        # ... += ... * B[k][j]
        lw t6, 0(t0)
        # ... += A[i][k] * B[k][j]
        mul t5, t5, t6 
        # aux1 += A[i][k] * B[k][j]
        add t4, t4, t5
        # A++
        addi a0, a0, 4
        # auxT2 += 4 (moves to the next column)
        addi t0, t0, 4
        # for(...,...,k++)
        addi t3, t3, 1 
        # for(...,k<N,...)
        blt t3, s9, f1loop3
        # }
        
        lw t0, 0(a4) #Get from C
        mul t0,t0,s8 #Mult by beta
        
        mul t4,t4,s7 #Mutiply by alpha right away
        add t4,t0,t4 #C[i,j]*beta + T1[i,j]*alpha
        
        sw t4, 0(a2) #Save
        
        # D++ C++
        addi a2, a2, 4
        addi a4, a4, 4
        
        # A -= N*4 (rewind to the first element of the row)
        sub a0, a0, a3
        # T2 goes to next row
        add a1, a1, a3
        # auxT2 = T2
        add  t0, zero, a1
        # for(...,...,j++)
        addi t2, t2, 1
        # for(...,j<N,...)
        blt t2, s9, f1loop2
        # }
        # A += N*4 (moves to the next row)
        add a0, a0, a3
        # Reset T2
        add a1, zero, s6
        # Reset T2 auxiliar
        add t0, zero, a1
        # for(...,...,i++) 
        addi t1, t1, 1
        # for(...,i<N,...) #Check if finished
        blt t1, s9, f1loop1
        # }

        # return
        li a7, 10
        ecall